import ErrorPage from "views/Pages/ErrorPage.js";
import LoginPage from "views/Pages/LoginPage.js";
import TimelinePage from "views/Pages/Timeline.js";

// @material-ui/icons
import Lock from "@material-ui/icons/Lock";

var dashRoutes = [
  {
    collapse: true,
    name: "Seguridad",
    icon: Lock,
    state: "pageCollapse",
    views: [
      {
        path: "/timeline-page",
        name: "Timeline Page",
        mini: "Permisos",
        component: TimelinePage,
        layout: "/admin"
      },
      {
        path: "/login-page",
        name: "Login Page",
        mini: " ",
        component: LoginPage,
        layout: "/auth"
      },
      {
        path: "/error-page",
        name: "Error Page",
        mini: " ",
        component: ErrorPage,
        layout: "/auth"
      }
    ]
  }
];
export default dashRoutes;
